const e={italian:"Italiano",english:"Inglese",japanese:"Giapponese",french:"Francese",german:"Tedesco",spanish:"Spagnolo",sun_description:"Il sole è una stella di dimensioni medie che si trova al centro del nostro sistema solare. È una sorgente di luce e calore che permette la vita sulla Terra. Composto principalmente da idrogeno e elio, genera energia attraverso la fusione nucleare. La sua massa e la sua gravità mantengono in orbita i pianeti e gli altri corpi celesti nel sistema solare."},n={italian:"Italian",english:"English",japanese:"Japanese",french:"French",german:"German",spanish:"Spanish",sun_description:"The sun is a medium-sized star located at the center of our solar system. It is a source of light and heat that sustains life on Earth. Composed mainly of hydrogen and helium, it generates energy through nuclear fusion. Its mass and gravity keep the planets and other celestial bodies in orbit around it."},a={italian:"Italiano",english:"Inglés",japanese:"Japonés",french:"Francés",german:"Alemán",spanish:"Español",sun_description:"El sol es una estrella de tamaño medio ubicada en el centro de nuestro sistema solar. Es una fuente de luz y calor que sustenta la vida en la Tierra. Compuesto principalmente por hidrógeno y helio, genera energía a través de la fusión nuclear. Su masa y gravedad mantienen en órbita a los planetas y otros cuerpos celestes en el sistema solar."},s={italian:"Italien",english:"Anglais",japanese:"Japonais",french:"Français",german:"Allemand",spanish:"Espagnol",sun_description:"Le soleil est une étoile de taille moyenne située au centre de notre système solaire. Il est une source de lumière et de chaleur qui permet la vie sur Terre. Principalement composé d'hydrogène et d'hélium, il génère de l'énergie par fusion nucléaire. Sa masse et sa gravité maintiennent en orbite les planètes et autres corps célestes du système solaire."},i={italian:"Italienisch",english:"Englisch",japanese:"Japanisch",french:"Französisch",german:"Deutsch",spanish:"Spanisch",sun_description:"Die Sonne ist ein mittelgroßer Stern, der sich im Zentrum unseres Sonnensystems befindet. Sie ist eine Quelle von Licht und Wärme, die das Leben auf der Erde ermöglicht. Hauptsächlich aus Wasserstoff und Helium bestehend, erzeugt sie Energie durch Kernfusion. Ihre Masse und Gravitation halten die Planeten und andere Himmelskörper in einer Umlaufbahn um sie."},t={italian:"イタリア語 (Italiago)",english:"英語 (Eigo)",japanese:"日本語 (Nihongo)",french:"フランス語 (Furansugo)",german:"ドイツ語 (Doitsugo)",spanish:"スペイン語 (Supeingo)",sun_description:"太陽は、太陽系の中心に位置する中程度の大きさの星です。地球上の生命を維持する光と熱の源です。主に水素とヘリウムで構成され、核融合によってエネルギーを生成します。その質量と重力によって、惑星や他の天体は太陽の周りを軌道上に保ちます。"},r={en:n,it:e,fr:s,de:i,es:a,jp:t};function l(){return{legacy:!1,locale:"en",messages:r}}const o=()=>l();export{o as default};
